var m = 460;
$(function(){
    $("textarea").each(function(){
        var e = $(this);
        updateField(e);
    });
	$("textarea").bind('keyup',function(e) {
		var e = $(this);
        updateField(e);
	});    
});
function updateField(e){
    if(e.val().length>m) {
        e.val(e.val().substr(0,m));
    }
    e.next('.chars').text(m - e.val().length);
}

